// Estado inicial de los puntajes
let currentGame = flow.get('currentGame') || { teamA: 0, teamB: 0, history: [] };

switch (msg.payload.action) {
    case "A":
        // Guardar el estado actual en el historial antes de cambiarlo
        currentGame.history.push({ teamA: currentGame.teamA, teamB: currentGame.teamB });
        currentGame.teamA += 1;
        break;
    case "B":
        // Guardar el estado actual en el historial antes de cambiarlo
        currentGame.history.push({ teamA: currentGame.teamA, teamB: currentGame.teamB });
        currentGame.teamB += 1;
        break;
    case "Undo":
        if (currentGame.history.length > 0) {
            // Recuperar el último estado del historial
            let previousState = currentGame.history.pop();
            currentGame.teamA = previousState.teamA;
            currentGame.teamB = previousState.teamB;
        }
        break;
    case "Reset":
        // Guardar el estado actual en el historial antes de resetearlo
        currentGame.history.push({ teamA: currentGame.teamA, teamB: currentGame.teamB });
        currentGame.teamA = 0;
        currentGame.teamB = 0;
        currentGame.history = [];
        break;
    default:
        node.warn("Acción no reconocida: " + msg.payload.action);
}

flow.set('currentGame', currentGame); // Guardar el estado actualizado en el contexto de flujo

msg.payload = { teamA: currentGame.teamA, teamB: currentGame.teamB }; // Actualizar el payload con el estado actual
return msg;

