            // Finalizar el set y preparar para un nuevo set o tiebreak
            sets.push({ gamesA: 0, gamesB: 0 });
        }

        // Resetear puntos para el siguiente juego
        game.pointsA = 0;
        game.pointsB = 0;
    }

    // Guardar cambios en el contexto
    flow.set('court', court);
}

